import React, { useState, useEffect } from "react";
import home from "../components/home";
function Protected() {
    useEffect(() => {
        if (!localStorage.getItem('user-info')) {
            return <redirect to="/register" />

        }
    })
    return (
        <div>
            <Nav />

        </div>

    );
};
export default Protected;
